import React from "react";

export const StyleCategory = ({setAttribute}) => {
    const logo = require('./apina2.png');
    return(
        
        <div className="image-input-pair">
                <button onClick={setAttribute(", watercolor painting")}><img src={logo} className="image" alt="my image"  /></button>
                <img src={logo} className="image" alt="my image" onClick={setAttribute(", watercolor painting")} />
                <img src={logo} className="image" alt="my image" onClick={setAttribute(", painting")} />
        </div>
    );
}
